@Tom Brand | StarkWare can u pls shed some light on this?

Assuming the sequencer response / transaction effect is not instant (which will probably always be the case), I think that this is an issue. A single app can handle it by simply waiting for the first transaction to end (not nice, but doable). 
But, think of a scenario where the user is interacting with 2 applications - one right after the other.  The user is doing a transaction with App1 and right after (within a couple of minutes) goes and do a transaction with App2 ---> the App2 transaction will fail and App2 will have no way to prevent this...

@Tom Brand | StarkWare maybe I missed something, but the new 0.6.2 release does not effect the transaction latency - from the release notes: `transactions in the new PENDING state will not be reflected in the API `
Plus, in practice, it still takes a few minutes (on Goerli Testnet) to get to `ACCEPTED_ON_L2`. 
If I understand correctly, the speed-up will come only in a future version.

